B.a2H=new A.bl("You can easily connect any field bloc with any widget you want using a `BlocBuilder`, but flutter_bloc_form offers you some widgets.\n* TextFieldBlocBuilder\n* DropdownFieldBlocBuilder\n* RadioButtonGroupFieldBlocBuilder\n* CheckboxFieldBlocBuilder\n* SwitchFieldBlocBuilder\n* CheckboxGroupFieldBlocBuilder\n* DateTimeFieldBlocBuilder\n* TimeFieldBlocBuilder\n\nTo use them you simply have to assign a field bloc.\n",B.aY,null)
